import { Route, Switch } from "react-router-dom";
import Login from "./components/Login.js";
import Navbar from "./components/navbar.js";
import Home from "./components/home.js";



function App() {
  return (
    <div className="App">
      <Navbar />
      <switch>
      <Route path="/">
          <Home />
        </Route>
        <Route path="/Login">
          <Login />
        </Route>
      </switch>


    </div>
  );
}

export default App;
